from typing import List


class Solution:

    def longestPrefix(self, s: str) -> str:

        if len(s) <= 1:
            return ""
        ans = ""
        for i in range(1, len(s)):
            if s.endswith(s[:i]):
                ans = s[:i]
        # print(ans)
        return ans

